import {createContext, useEffect, useState} from 'react';
import axios from 'axios';

export const AuthenticationContext = createContext(null);

export const AuhtenticationProvider = (props:any) => {

    let AuthenticationStatus = ['loggedIn' , 'loggedOut' , 'uncertain'];

    useEffect(() => {
        axios.get('auth/refreshtoken')
            .then((response) => console.log(response))
            .catch((err) => console.log(AuthenticationStatus));
    }, []);

    const [movies, setMovies] = useState();





    return (
        <AuthenticationContext.Provider value={[movies, setMovies]}>
            {props.children}
        </AuthenticationContext.Provider>
    )

}
